/*.............................................................. */

class App extends React.Component {

	render(){
		const [Section, useSection] = useState({sec : 1})
		return (
			<div className="App">
				  <header className="header_area">
					<TopSM/>
					<MMenu1/>
				  </header>
				<Sec1 />  
				<Sec2 /> 
				<Timer/> 
				<LatestProduct/>
				<ClientLogo/>
				<LastSearched/>
				<Footer1/>

			</div>
		  );
	}

}

export default App;
